<?php
//global variables

//salt used for md5 hashing to hide logs. 
$salt="salt123";

// This gets the IP address and attempts to see if user is using proxy server
if (getenv(HTTP_X_FORWARDED_FOR)) {
	$pipaddress = getenv(HTTP_X_FORWARDED_FOR);
	$ipaddress = getenv(REMOTE_ADDR);
	$ip = $pipaddress;
	$ipProxy = $pipaddress. "(via $ipaddress)" ;
} else {
	$ipaddress = getenv(REMOTE_ADDR);
	$ip = $ipaddress;
	$ipText = $ipaddress;
}

//Where the script is hosted
$domain = $_SERVER['HTTP_HOST'];
$serverIPAddress = $_SERVER['SERVER_ADDR'];
$path=$_SERVER['SCRIPT_NAME'];

//user agent can tell browser, and plugins
$userAgent = $_SERVER['HTTP_USER_AGENT'];

// How did they get to the email? Web or outlook?
$ref = $_SERVER['HTTP_REFERER'];

//We will use MD5 with salts to create this id, this can be matched in a database and see who viewed/clicked on the link
//used for anything with an <a href> tag
$emailTagLink = $_GET['a'];
//used for anything with an <img src> tag
$emailTagImage = $_GET['img'];
//used for anything with an <a href> tag
$error = $_GET['e'];
//cache will be used to hide the API key for each user, viewing will still be protected
//by username and password
$cache = $_GET['cache'];
//log date and time
$date=date("F j, Y, g:i a"); 

// Output to the screen for testing, remove and replace with something believable when done
//echo "$message";
//echo $_SERVER['QUERY_STRING'];

//This is what we will include in our output, it could be converted to json, but for now is csv
$message = "\n<br>".$emailTagLink.$emailTagImage.",".$domain.$path.",".$ipText.",".$ipProxy.",".$userAgent.",".$ref.",".$date;
//echo md5('salt431'."joshingeneral@gmail.com".'salt431');

// So cache is used for private emails
// if wanted a user can specify a private key so that only they can open the logs
// if left blank it will just be put into the regular logs.csv file

// Normally this is done for sites where you deploy the tool and multiple pen testers will be accessing the account
// or if you want to designate different campaigns 

//use the md5hash to prevent users creating bad files
// just know we are hashing a hash with salts twice, so in results we must do the same to have it match
// you can mix this up in your own instance in order to avoid someone guessing it.
$cacheMD5=md5($salt.$cache.$salt);
if ($_GET['cache'] == "") {
		$outputFile = fopen("logs/log.csv", "a+") or die("Unable to open file!");
		fwrite($outputFile, $message);
		fclose($outputFile);
   }
   else {
		$outputFile = fopen("logs/$cacheMD5.csv", "a+") or die("Unable to open file!");
		fwrite($outputFile, $message);
		fclose($outputFile);
   }
	   
if ($_GET['cache'] == "") {
		$outputFile = fopen("logs/log.txt", "a+") or die("Unable to open file!");
		fwrite($outputFile, $message);
		fclose($outputFile);
	} else {
		$outputFile = fopen("logs/$cacheMD5.txt", "a+") or die("Unable to open file!");
		fwrite($outputFile, $message);
		fclose($outputFile);
   }

//Error Page could be 403 or 404, however you like
//If there is no error it will just show a white image, this way we can embed images w/o 
//there being error in the email program
if ($error == "1") {
	echo "<!DOCTYPE HTML PUBLIC \"-//IETF//DTD HTML 2.0//EN\">
	<html><head>
	<title>404 Not Found</title>
	</head><body>
	<h1>Not Found</h1>
	<p>The requested URL $path was not found on this server.</p>
	<hr>
	<address>Apache/2.4.7 (Ubuntu) Server at $serverIPAddress Port 80</address>
	</body></html>
	";
} else if ($error == "2") {
	echo "<!DOCTYPE HTML PUBLIC \"-//IETF//DTD HTML 2.0//EN\">
	<html><head>
	<title>403 Forbidden</title>
	</head><body>
	<h1>Forbidden</h1>
	<p>You don't have permission to access $path
	on this server.</p>
	<hr>
	<address>Apache/2.4.7 (Ubuntu) Server at $serverIPAddress Port 80</address>
	</body></html>
	";
} else{
	// you can embed an image via base64, however it wouldn't show in the email client, will still work on this some but for now let's just make it empty on direct open. 
#echo "<img src=\"data:image/jpg;base64,\"/>";
}



	

?>